$('.form__submit').click(function () {
    var form = $(this).parents('.form');
    var formAttr = $(this).parents('.form').attr("data-form");
    form.addClass(formAttr);

    var formClass = '.' + formAttr;
    var input = $(formClass + ' ' + '.form_required');
    var btn = $(formClass + ' ' + '.form__submit');

    var flag = true;

    input.each(function (i) {
        if (this.value == '') {
            $(this).parents('.form__group').addClass('validation-error');
            flag = false;
        } else {
            $(this).parents('.form__group').removeClass('validation-error');
        }
    });

    if (!flag) {
        btn.attr('disabled', 'disabled');
    }
    if (flag) {
        btn.attr('disabled', false);
        form.addClass('form_valid');
    }

    input.change(function () {
        $(this).parents('.form__group').removeClass('validation-error');
        $(this).parents('.form__group').removeClass('group-validation');

        if ($(formClass + ' ' + '.form__group').hasClass("group-validation")) {
            btn.attr('disabled', 'disabled');
        } else {
            btn.attr('disabled', false);
            form.addClass('form_valid');
        }
    });
});


// Focus

$('.form__control').on('focus', function () {
    $(this).parents('.form__group').addClass('focus')
});

$('.form__control').on('blur', function () {
    if (this.value.length === 0) {
        $(this).parents('.form__group').removeClass('focus')
    }
});


// Password

$('body').on('click', '.password-visibility', function () {
    var passwordId = $(this).attr('data-id');
    if ($(".password[data-id='" + passwordId + "']").attr('type') == 'password') {
        $(this).addClass('view');
        $(".password[data-id='" + passwordId + "']").attr('type', 'text');
    } else {
        $(this).removeClass('view');
        $(".password[data-id='" + passwordId + "']").attr('type', 'password');
    }
    return false;
});


// Copy Txt

$(document).ready(function () {
    $('.copy__btn').click(function () {
        var copyId = $(this).attr('data-id');
        var $temp = $("<input>");
        $("body").append($temp);
        $temp.val($('#' + copyId + '').text()).select();
        $('#' + copyId + '').css('background', 'rgb(226 229 236 / 90%)');

        function cbg() {
            $('#' + copyId + '').css('background', 'rgb(226 229 236 / 0%)');
        }
        setTimeout(cbg, 1200);

        document.execCommand("copy");
        $temp.remove();
    });
});



// File

const uploadInput = document.querySelector(".upload__input");

if (uploadInput) {
    uploadInput.addEventListener("change", (e) => {
        const [file] = e.target.files;
        const { name: fileName, size } = file;
        const fileSize = (size / 1024).toFixed(2);
        const fileNameAndSize = `${fileName}, ${fileSize} K`;
        const image = document.querySelector('.upload__img img');
        image.src = URL.createObjectURL(file);
        //document.querySelector(".upload__info").textContent = fileNameAndSize;
    });
}






$(window).on('load', function () {
	function anims() {
		$('.start-anim').addClass('anim');
	}
	setTimeout(anims, 1000);
});

AOS.init({
	easing: 'ease-out-back',
	duration: 1000,
	disable: function () {
		var maxWidth = 1100;
		return window.innerWidth < maxWidth;
	}
});

$(document).scroll(function () {
	var WinTop = $(window).scrollTop();
	var docHeight = $(window).height();

	$('.fadeEl').each(function () {
		var topIn = $(this).offset().top - docHeight * 0.80;
		if (WinTop > topIn) {
			$(this).addClass('anim');
		}
	});

	$('.animation').each(function () {
		var topIn = $(this).offset().top - docHeight * 0.80;
		if (WinTop > topIn) {
			$(this).addClass('start-animation');
		}
	});
});


/////////////////////////////
//       header           //
///////////////////////////

$("document").ready(function ($) {
	$(window).scroll(function () {
		if ($(this).scrollTop() > 50) {
			$('.header').addClass("fix");

		} else {
			$('.header').removeClass("fix");
		}
	});
});


/////////////////////////////
//       anchor           //
///////////////////////////

$('.anchor').on('click', function () {
	var href = $(this).attr('href');
	$('.anchor').removeClass('active');
	$(this).addClass('active');
	$('html, body').animate({
		scrollTop: $(href).offset().top - 80
	}, {
		duration: 370,
		easing: "linear"
	});
	return false;
});


/////////////////////////////
//      dropdown          //
///////////////////////////

$(document).ready(function () {
	$(".dropdown__btn").click(function () {
		$(this).siblings(".dropdown__list").slideToggle('medium');
		$(this).toggleClass('active');
	});
});


/////////////////////////////
//      vh mobile         //
///////////////////////////

let vh = window.innerHeight * 0.01;
document.documentElement.style.setProperty('--vh', `${vh}px`);

window.addEventListener('resize', () => {
	let vh = window.innerHeight * 0.01;
	document.documentElement.style.setProperty('--vh', `${vh}px`);
});


//////////////////////////////////////
//      sidebar link active        //
////////////////////////////////////

$(function () {
	var current = location.pathname;
	$('.sidebar__link').each(function () {
		var $this = $(this);

		if ($this.attr('href').indexOf(current) !== -1) {
			$this.addClass('active');
		}
	})
})


//////////////////////////////////////
//      progress value full        //
////////////////////////////////////

$(document).ready(function () {
	$('.progress progress').each(function () {
		var $this = $(this);

		let progressValue = $this.val();
		let progressMax = $this.attr('max');

		$this.parent('.progress').find('.progress__val').html(progressValue);
		$this.parent('.progress').find('.progress__max').html(progressMax);

		if (progressValue < progressMax) {
			$this.parent().removeClass('progress-full');
		} else {
			$this.parent().addClass('progress-full');
		}
	})
});


////////////////////////////////
//      simple-slider        //
//////////////////////////////

var simpleSliderSwiper = new Swiper(".simple-slider .swiper", {
	spaceBetween: 30,
	centeredSlides: true,

	autoplay: {
		delay: 2500,
		disableOnInteraction: false,
	},

	navigation: {
		nextEl: ".simple-slider .swiper-button-next",
		prevEl: ".simple-slider .swiper-button-prev",
	},


	effect: "creative",
	creativeEffect: {
		prev: {
			shadow: true,
			translate: ["-120%", 0, -500],
		},
		next: {
			shadow: true,
			translate: ["120%", 0, -500],
		},
	},

	loop: true,
});


//////////////////////////
//      counter        //
////////////////////////

const counter = () => {
	var counterMinus = $('.counter .minus');
	var counterPlus = $('.counter .plus');

	counterMinus.click(function () {
		var $input = $(this).parent().find('input');
		var count = parseInt($input.val()) - 1;
		count = count < 1 ? 1 : count;
		$input.val(count);
		$input.change();
		return false;
	});
	counterPlus.click(function () {
		var $input = $(this).parent().find('input');
		$input.val(parseInt($input.val()) + 1);
		$input.change();
		return false;
	});
}

// menu-dropdown
$(document).on("ready", function () {
	$(".menu-dropdown").click(function () {
		$(".menu-dropdown").not($(this)).removeClass('open');
		$(this).toggleClass("open");
	});

	$('.menu-dropdown').mouseleave(function () {
		$(this).removeClass('open');
	});
});



